module.exports = {
  isValidHostElementName,

  isNode,
  isSlotable,
  isSlot,
  isShadowRoot,

  isShadowInclusiveAncestor,
  retarget,
  getEventTargetParent,
  shadowIncludingRoot,

  assignSlot,
  assignSlotable,
  assignSlotableForTree,

